def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    # Perform aggregation based on the 'how' parameter
    if how == 'mean':
        result = data._get_numeric_data().mean(axis=0, skipna=True, min_count=min_count)
    elif how == 'median':
        result = data._get_numeric_data().median(axis=0, skipna=True)
    elif how == 'var':
        result = data._get_numeric_data().var(axis=0, skipna=True, ddof=1, min_count=min_count)
    else:
        # Handle other aggregation types if needed
        result = None

    if result is None:
        raise ValueError("Invalid 'how' parameter for aggregation")

    # Create a FloatBlock for the aggregation result
    agg_block = data._simple_block(yielded=result, items=data.items)

    # Prepare the return values (agg_blocks and items)
    agg_blocks = [agg_block]
    agg_items = data.items

    return agg_blocks, agg_items
